import React from "react";
import {Container, Row, Col, Image} from "react-bootstrap";
import "./footerLogos.css";

const FooterLogos = () => {
    return (
        <Container className = "footerLogoContainer">
            <Row className = "footerLogoRow">
            <Col className = "footerLogoCol" >        
                <Image  className = "fbLogo" src = "https://en.facebookbrand.com/wp-content/uploads/2019/04/f_logo_RGB-Hex-Blue_512.png"> 
                </Image> 
            </Col>      
            <Col className = "footerLogoCol" >     
                <Image className = "liLogo" src = "https://cdn3.iconfinder.com/data/icons/social-icons-5/606/LinkedIn.png"> 
                </Image> 
            </Col> 
            </Row>
        </Container>

    )
}

export default FooterLogos;
